USE Accounts 
GO

if exists (select * from sysobjects 
  where id = object_id('dbo.CustInfo') and sysstat & 0xf = 3)
  drop table dbo.CustInfo
GO

create table CustInfo (
	AccountNo CHAR(12),
	Name VARCHAR(50),
	NRIC CHAR(9),
	Contact VARCHAR(20),
	PinNumber CHAR(6),
	AccountBalance MONEY,
	WithdrawalLimit MONEY,
	TransferLimit MONEY,
	AvgWithdrawal MONEY,

	CONSTRAINT PK_Accounts PRIMARY KEY(AccountNo)
);	


CREATE TABLE TransferRecords (
	TransferRecordID INT IDENTITY(1,1) NOT NULL,
	AccountNo CHAR(12) NOT NULL,
	TransferAccountNo CHAR(12) NOT NULL,
	TransferAmount MONEY NOT NULL,
	TransferPending BIT NOT NULL,

	CONSTRAINT PK_TransferRecords PRIMARY KEY(TransferRecordID)
)

